prompt:
# Given a list of integers, return a new list with the elements sorted in ascending order. Do not use the built-in sort command.
# >>> sort_list {3 1 4 1 5 9}
# {1 1 3 4 5 9}
proc sort_list {numbers} {

canonical_solution:
    set length [llength $numbers]
    for {set i 0} {$i < $length} {incr i} {
        for {set j [expr {$i + 1}]} {$j < $length} {incr j} {
            if {[lindex $numbers $i] > [lindex $numbers $j]} {
                set temp [lindex $numbers $i]
                lset numbers $i [lindex $numbers $j]
                lset numbers $j $temp
            }
        }
    }
    return $numbers
}

